import React from 'react';
import HomePage from './HomePage';
import RecipePage from './RecipePage';
import { Switch, Route } from 'react-router-dom';

function PageRouter() {
	return (
		<Switch>
			<Route exact path="/">
				<HomePage />
			</Route>
			<Route path="/recipe/:id">
				<RecipePage />
			</Route>
		</Switch>
	);
}

export default PageRouter;

